      "photo": "https://previews.123rf.com/images/trueffelpix/trueffelpix1605/trueffelpix160500018/58037157-vector-ilustraci%C3%B3n-de-la-p%C3%A1gina-de-error-no-encontrado.jpg",
      "idUser": Math.random,
      "buyerId": null,
      "createdAt": "2022-01-04T23:00:00.000Z",
      "modifiedAt": null
  }
]

function HomePage({user, setUser}) {
  const [search, setSearch] = useState('')
  const [show, setShow] = useState(false)
  return (
    <div className="App">
      <header className="header">
       <Logo />
       <Buscar setSearch={setSearch} />
       <Sesion show={show} setShow={setShow} setUser={setUser}/>
      </header>
      <aside className='aside'>

      </aside>
      <main className='main'>
        {search ? <Products products={search}/> : <NotFound />}
      </main>
      <footer className='footer'>+

      </footer>
    </div>
  );
}

export default HomePage;
